import React from "react";
import './AugmentedTeam.css';
import "@fontsource/red-hat-display";
import './../min.css';
import augmented_bg from './resources/augmented_bg.svg'
function Display(){
    return(
        <div className="body-augmented">

            <h1>Introducing to our<br/>Augmented Team</h1>
            <p>Let us streamline your organization’s adoption of DevOps practices. We’ll provide a complete turnkey Devops solution your team can run with well into the future.</p>

        </div>
    );


}
export default Display;
